import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header className="header">
      <div className="container flex justify-between items-center">
        <Link to="/" className="text-2xl font-bold">Directory Maker</Link>
        <nav>
          <ul className="flex space-x-6">
            <li><Link to="/features" className="hover:text-gray-700">Features</Link></li>
            <li><Link to="/pricing" className="hover:text-gray-700">Pricing</Link></li>
            <li><Link to="/faq" className="hover:text-gray-700">FAQ</Link></li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
